    [],nt"revision_timestamp": "2015-06-10T02:35:14.448337",nt"name": "jpeg-image-of-seismic-reflection-profiles-collected-in-the-pulley-ridge-study-areabe49e",nt"isopen":
    false,nt"url": null,nt"notes": "These seismic data were collected to infer
    the paleodepositional environment of Pulley Ridge through seismic facies analysis.
    Without actual rock cores, remote sensing is the next best tool. It was uncertain
    if Pulley Ridge represented a drowned reef or paleoshoreline. Through seismic imaging,
    it was determined from the high-amplitude, level-bedded nature of material in the
    sub-surface that Pulley Ridge represents several stages of barrier-island development.
    For more information on the seismic surveys see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2001-010-FA
    These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
    Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
    applications.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
